import _defineProperty from '@babel/runtime/helpers/esm/defineProperty';
import FieldController from '@keystonejs/fields/Controller';

class LocationGoogleController extends FieldController {
  constructor(...args) {
    super(...args);

    _defineProperty(this, "getQueryFragment", () => `
    ${this.path} {
       id
       googlePlaceID
       formattedAddress
       lat
       lng
    }
  `);
  }

}

export default LocationGoogleController;
